import React, { useState, useEffect } from "react";
import { Line } from "react-chartjs-2";

const EmployeeDashboard = () => {
  const [employee, setEmployee] = useState(null);
  const [notifications, setNotifications] = useState([]);
  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    const userId = localStorage.getItem("userId");

    if (userId) {
      // Fetch Employee Data
      fetch(`http://localhost:8085/api/employees/get/${userId}`)
        .then((response) => response.json())
        .then((data) => setEmployee(data))
        .catch((error) => console.error("Error fetching employee data:", error));

      // Fetch Notifications
      fetch(`http://localhost:8085/api/notifications/${userId}`)
        .then((response) => response.json())
        .then((data) => setNotifications(data))
        .catch((error) => console.error("Error fetching notifications:", error));

      // Fetch Tasks
      fetch(`http://localhost:8085/api/tasks/${userId}`)
        .then((response) => response.json())
        .then((data) => setTasks(data))
        .catch((error) => console.error("Error fetching tasks:", error));
    } else {
      console.error("No user ID found in localStorage");
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("userId");
    alert("Logged out successfully!");
    window.location.href = "/";
  };

  if (!employee) {
    return <div>Loading employee data...</div>;
  }

  return (
    <div className="employee-dashboard">
      <header className="dashboard-header">
        <div className="logo">Employee Dashboard</div>
        <div className="profile">
          <span>{employee.name}</span>
          <button className="logout-button" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </header>

      <section className="main-dashboard">
        <div className="row">
          <div className="col-xl-10">
            <h2>Welcome, {employee.name}!</h2>
          </div>
          <div className="col-xl-2 align-content-right">
            <Link to="/empheader/editprofile">
              <button type="button" className="btn btn-secondary">
                Edit Profile
              </button>
            </Link>
          </div>
          <div className="employee-info">
            <p>
              <strong>Id:</strong> EMP-{employee.id}
            </p>
            <p>
              <strong>Name:</strong> {employee.name}
            </p>
            <p>
              <strong>Department:</strong> {employee.department}
            </p>
            <p>
              <strong>Email:</strong> {employee.email}
            </p>
          </div>
        </div>
      </section>

      {/* Notifications Section */}
      <section className="notifications">
        <h3>Recent Notifications</h3>
        {notifications.length > 0 ? (
          <ul>
            {notifications.map((notification) => (
              <li key={notification.id}>{notification.message}</li>
            ))}
          </ul>
        ) : (
          <p>No new notifications.</p>
        )}
      </section>

      {/* Tasks Section */}
      <section className="tasks">
        <h3>Your Tasks</h3>
        {tasks.length > 0 ? (
          <div className="task-container">
            {tasks.map((task) => (
              <div key={task.id} className={`task-card ${task.status.toLowerCase()}`}>
                <h4>Task: {task.title}</h4>
                <p>Description: {task.description}</p>
                <p>Status: {task.status}</p>
              </div>
            ))}
          </div>
        ) : (
          <p>No tasks assigned.</p>
        )}
      </section>

      {/* Action Buttons */}
      <section className="action-buttons">
        <Link to="/empheader/assignments">
          <button className="action-button">View Assignments</button>
        </Link>
        <Link to="/empheader/performance">
          <button className="action-button">Performance Reports</button>
        </Link>
      </section>
    </div>
  );
};


export default EmployeeDashboard;
